import {Navbar, Nav, Container} from 'react-bootstrap';
import './Navbars.css';
import { useState } from 'react';
import CheckModal from '../../modals/CheckModal';

const Navbars=()=>{
    const [checkshow, setcheckShow] = useState(false);

    const CheckClose = () => setcheckShow(false);
    const CheckShow = () => setcheckShow(true);

    return(
        <Navbar bg="dark" variant="dark" style={{fontWeight: "bold"}}>
            <Container id='container'>
                <Navbar.Brand>
                    <img className='Logo' src="imgs/Taxi-Logo.png"
                    style={{width: "60px", height: "60px"}}/>
                </Navbar.Brand>
                <Nav className="me-auto">
                    <Nav.Link onClick={CheckShow}>Make</Nav.Link>
                    <Nav.Link>My</Nav.Link>
                    <Nav.Link href="/Setting">Setting</Nav.Link>
                </Nav>
            </Container>
        </Navbar>

    )
}

export default Navbars;
